  /**
   * Fetches all tweets quoting a given tweet ID by chaining requests
   * until no more pages are available.
   * @param quotedTweetId The tweet ID to find quotes of.
   * @param maxTweetsPerPage Max tweets per page (default 20).
   * @returns An array of all Tweet objects referencing the given tweet.
   */
  public async getAllQuotedTweets(
    quotedTweetId: string,
    maxTweetsPerPage = 20,
  ): Promise<Tweet[]> {
    const allQuotes: Tweet[] = [];
    let cursor: string | undefined;
    let prevCursor: string | undefined;

    while (true) {
      const page = await fetchQuotedTweetsPage(
        quotedTweetId,
        maxTweetsPerPage,
        this.auth,
        cursor,
      );

      // If there's no new tweets, stop
      if (!page.tweets || page.tweets.length === 0) {
        break;
      }

      allQuotes.push(...page.tweets);

      // If next is missing or same => stop
      if (!page.next || page.next === cursor || page.next === prevCursor) {
        break;
      }

      // Move cursors
      prevCursor = cursor;
      cursor = page.next;
    }

    return allQuotes;
  }
}

import { getScraper } from './test-utils';
import { SearchMode } from './search';
import { QueryTweetsResponse } from './timeline-v1';

test('scraper can process search cursor', async () => {
  const scraper = await getScraper();

  let cursor: string | undefined = undefined;
  const maxTweets = 30;
  let nTweets = 0;
  while (nTweets < maxTweets) {
    const res: QueryTweetsResponse = await scraper.fetchSearchTweets(
      'twitter',
      maxTweets,
      SearchMode.Top,
      cursor,
    );

    expect(res.next).toBeTruthy();

    nTweets += res.tweets.length;
    cursor = res.next;
  }
}, 30000);

test('scraper can search profiles', async () => {
  const scraper = await getScraper();

  const seenProfiles = new Map<string, boolean>();
  const maxProfiles = 150;
  let nProfiles = 0;

  const profiles = scraper.searchProfiles('Twitter', maxProfiles);
  for await (const profile of profiles) {
    nProfiles++;

    const profileId = profile.userId;
    expect(profileId).toBeTruthy();

    if (profileId != null) {
      expect(seenProfiles.has(profileId)).toBeFalsy();
      seenProfiles.set(profileId, true);
    }
  }

  expect(nProfiles).toEqual(maxProfiles);
}, 30000);

test('scraper can search tweets', async () => {
  const scraper = await getScraper();

  const seenTweets = new Map<string, boolean>();
  const maxTweets = 150;
  let nTweets = 0;

  const profiles = scraper.searchTweets(
    'twitter',
    maxTweets,
    SearchMode.Latest,
  );

  for await (const tweet of profiles) {
    nTweets++;

    const id = tweet.id;
    expect(id).toBeTruthy();

    if (id != null) {
      expect(seenTweets.has(id)).toBeFalsy();
      seenTweets.set(id, true);
    }

    expect(tweet.permanentUrl).toBeTruthy();
    expect(tweet.isRetweet).toBeFalsy();
    expect(tweet.text).toBeTruthy();
  }

  expect(nTweets).toEqual(maxTweets);
}, 30000);

import { addApiFeatures, requestApi } from './api';
import { TwitterAuth } from './auth';
